import React, { useState } from "react";
import { Footer } from "../../pages/Home/styles";
import { ActionContainer, CustomForm, CustomInput, FormBody, FormTitle, FormWrapper, SubmitButton } from "../styles";
const Home = () => {
  return (
    <FormBody>
    <ActionContainer>
    <img src="/images/navLogo.svg" alt="logo" />
        <div>Logout</div>
    </ActionContainer>
      <FormTitle>
          Enter your Details
      <FormWrapper>
      <CustomForm
                name="basic"
                labelCol={{ span: 8 }}
                wrapperCol={{ span: 16 }}
                initialValues={{ remember: true }}
                autoComplete="off"
              >
                <CustomForm.Item
                  name="username"
                  rules={[
                    { required: true, message: "Please input your username!" },
                  ]}
                >
                  <CustomInput
                    placeholder="Enter your username"
                  />
                </CustomForm.Item>


                <CustomForm.Item>
                  <SubmitButton type="primary" htmlType="submit">
                    Submit
                  </SubmitButton>
                </CustomForm.Item>
              </CustomForm>
      </FormWrapper>
      </FormTitle>
      <Footer>
        <div>Â© LazySprinters 2021 </div>
        <div>Terms and Condition</div>
      </Footer>
    </FormBody>
  );
};

export default Home;
